import React, { useEffect, useState } from "react";

function TaggedAnimals() {
    const [taggedAnimals, setTaggedAnimals] = useState()

    useEffect(() => {
        fetch("/tagged_animals")
        .then((res) => res.json())
        .then((res) => setTaggedAnimals(res))
    })

    return (
        <h1>{taggedAnimals}</h1>
    )
}

export default TaggedAnimals;
